import  React,{ Component } from 'react';

class Form extends Component {

    constructor(props) {
        super(props);

        this.state = {
            'maths': '',
            'physics': '',
            'chemistry': '',
            'biology': '',
            'english': ''
        }
    }

    render() {
        return (
            <form>
                <div>
                    <label>Calculate the percentage level of a Person's mark</label>
                </div>
                <div>
                   <input type='text'/>
                </div>
                <div>
                   <button>Get Data From Server</button>
                </div>
            </form>
        )
    }
} 

export default Form;
